import Expenses from "./components/Expenses";
function App(){
    let expenses=[
        {
            id:'e1',
            title:'school fee',
            amount: 250,
            date: new Date(2021,5,12)

        },

        {
            id:'e2',
            title:'B',
            amount: 300,
            date: new Date(2021,5,13)

        },

        {
            id:'e3',
            title:'c',
            amount: 350,
            date: new Date(2021,5,14)

        },

        {
            id:'e4',
            title:'d',
            amount: 400,
            date: new Date(2021,5,15)

        }

    ]

        return(
            <div>

                <h2>let gets started</h2>

                <expenses item ={expenses} >

                </expenses>

            </div>
        );




    
}
